import React from 'react';

const WindSwitch = ({ video }) => {

    return (
        <table className="ui two very basic column table">
            <tbody>
                < td >
                    <input
                        type="radio"
                        checked="checked"
                    />
                    <label>On</label>
                </td >
                <td>
                    <input
                        type="radio"
                        checked="unchecked"
                    />
                    <label>Off</label>
                </td>
            </tbody>
        </table >
    );
};

export default WindSwitch;
